import React from 'react';

const About =() => {
    return(
        <div>
            <p className={'pt-5'}>WELCOME</p>
            <h3>About us</h3>
            <img className="card-img-right" src={require('./images/MicrosoftTeams-image (1).png')} alt="Card image cap" style={{ height: '20%', width:'50%'}}/>
        </div>
    )
}

export default About;
